   "1_start"=>"<a href=\"/work_logs/edit/13969541\">29/06/2015 11:23</a>",
   "4_user"=>"Mariana Ventura Ribeiro",
   "5_note"=>
    "<span style=\"color: #3A87AD; font-weight: bold;\">Análise e estudo</span><br />A responsabilidade pelo pagamento das custas de perícia é da União, conforme §1º do art. 12 da Lei 10.259:\r <br/>\r <br/>§ 1º Os honorários do técnico serão antecipados à conta de verba orçamentária do respectivo Tribunal e, quando vencida na causa a entidade pública, seu valor será incluído na ordem de pagamento a ser feita em favor do Tribunal.\r <br/>\r <br/>Assim, caso a justiça gratuita não seja deferida, teremos que arcar apenas com as custas recursais."},
