   "5_note"=>
    "<span style=\"color: #F89406; font-weight: bold;\">Ligação Telefônica</span><br />Conversa com a Dra. Joyce, da Ipanema.\r <br/>Ela pede uma posição sobre os valores devidos no processo da Luana do Espirito Santo Teixeira (RT 0000896-79.2014.5.03.0184).\r <br/>O Santander já depositou a parte dele e fomos intimados, juntamente com a Losango, a fazer o pagamento do remanescente.\r <br/>A Losango, por sua vez, cobra da Ipanema que faça esse pagamento.\r <br/>Informei a ela que não temos uma posição da Diretoria da BRH sobre esse pagamento e que quem tem feito os pagamentos tem sido o Santander.\r <br/>Orientei a ela que tome as medidas que entender cabíveis, pois não passaremos mais nenhum dado ou informação.\r <br/>Na sequencia, contatei o Fernando e repassei com ele essas questões.\r <br/>MFS"},
