    "<span style=\"color: #3A87AD; font-weight: bold;\">Análise e estudo</span><br />0002188-43.2013.503.0020 - BRH x Flávio Vieira - Análise da sentença afim de identificar pontos controversos, omissos ou obscuros. Conclui-se:\r <br/>\r <br/>- Pag 5: Referência sobre a incidência de juros e correção monetária sobre danos morais. Acontece que não há pedido de danos morais na inicial.\r <br/>\r <br/>- Pag 6: Dispositivo 1.3: Erro material: A determinação do prazo para cumprimento das obrigações de fazer, estabelecidas no referido dispositivo, se deu de forma dúbia e imprecisa, apresentando clara obscuridade no que tange a satisfação dessas obrigações. Por consequência, não há de se elencar consequências pecuniárias e/ou administrativas para as Reclamadas, caso estas não cumpram com o referido prazo, que não se sabe ao certo qual é. \r <br/>\r <br/>- Não se manifestou sobre o pedido de caracterização de litigância da má-fé do Reclamante nos termos alegados na Contestação."},
